import React from 'react';
import Ninjas from './Ninjas';

function App() {
  let state = {
    ninjas : [
      { name: 'Ryu', age: 30, belt:'black', id: '1'},
      { name: 'Ken', age: 20, belt:'yellow', id: '2'},
      { name: 'Lee', age: 30, belt:'blue', id: '3'}
    ]
  };
  return (
    <div className="App">
      <h1>My first react App</h1>
      <p>Welcome :)</p>
      <Ninjas ninjas={state.ninjas} />
    </div>
  );
}

export default App;
